from gui_utils import LoginButton


class Account:
    def __init__(self, id=None, name=None, identity=None, group=None):
        self.id, self.name, self.identity, self.group = id, name, identity, group
        if self.identity == '学生':
            self.refer = '同学'
        elif self.identity == '教师':
            self.refer = '老师'
        else:
            self.refer = '管理员'


class Ui_MainWindow(QtWidgets.QMainWindow):
    activate_homepage = QtCore.pyqtSignal()
    def __init__(self, db):
        super(Ui_MainWindow,self).__init__()
        self.setupUi(self)
        self.retranslateUi(self)
        self.db = db
        self.account = None

    def ButtonLogin_Click(self):
        acc, pwd = self.lineEdit.text(), self.lineEdit_2.text()
        login_res = self.db.login(acc, pwd)
        if isinstance(login_res, str):
            QtWidgets.QMessageBox.information(self, '登陆失败', login_res, QtWidgets.QMessageBox.Yes)
            self.lineEdit.setText('')
            self.lineEdit_2.setText('')
        else:
            self.account = Account(self.db.userid2account(login_res[0]), login_res[2], login_res[1], login_res[3])
            self.lineEdit.setText('')
            self.lineEdit_2.setText('')
            self.activate_homepage.emit()
            self.hide()

